:"file:///D:/Backup-Project/src/main/resources/features/03.MenuAdmin.feature","name":"Check copy-paste operation pada Search Bar","language":"en","steps":[{"astNodeIds":["44f62a24-96b9-4600-a828-0bb0f0564ee0"],"id":"91be7957-af1c-430a-9ac1-d2c59bbfc978","type":"Action","text":"Admin input keyword kedalam searchbar"},{"astNodeIds":["7294fb2a-2f70-47ad-ae2b-e24fc9e77e7e"],"id":"1fca13d4-29ed-4167-a37c-a43e9c2390da","type":"Action","text":"Admin melakukan operasi copy terhadap keyword yang diinput"},{"astNodeIds":["bcd48ff2-2c3f-4e37-9964-36ada03d0c0c"],"id":"ccc5935b-deb1-4ce7-849a-f26b1a051e3f","type":"Action","text":"Admin melakukan operasi paste terhadap keyword yang dicopy"},{"astNodeIds":["b4f7d7d5-9f8b-46fb-a044-ad182ed93720"],"id":"3d1f88a4-84ef-4f3f-885a-3a58a4de6c00","type":"Outcome","text":"Admin dapat melihat keyword yang di copy-paste"}],"tags":[],"astNodeIds":["8351c4ca-9307-452a-83a2-56b390e08a8a"]}},{"source":{"uri":"file:///D:/Backup-Project/src/main/resources/features/04.FormAddAdmin.feature","data":"Feature: Form Add Admin Test\r\n\r\n#TCC.PO.018\r\nScenario: Cek input form dengan field Full Name kosong\r\nGiven Admin berada di form Add Admin\r\nWhen Admin input field Privilege\r\nAnd Admin input field Supervisor\r\nAnd Admin input field Telephone\r\nAnd Admin input field Username\r\nAnd Admin input field Password\r\nAnd Admin klik tombol Save\r\nThen Muncul tampilan warning Mohon Lengkapi Data\r\n\r\n#TCC.PO.019\r\nScenario: Cek input form dengan field Privileges kosong\r\nWhen Admin input field Full Name\r\nAnd Admin kosongkan field Privileges\r\nAnd Admin klik tombol Save\r\nThen Muncul tampilan warning Mohon Lengkapi Data\r\n\r\n#TCC.PO.020\r\nScenario: Cek input form dengan field Supervisor kosong\r\nWhen Admin input field Privilege\r\nAnd Admin kosongkan field Supervisor\r\nAnd Admin klik tombol Save\r\nThen Muncul tampilan warning Mohon Lengkapi Data\r\n\r\n#TCC.PO.021\r\nScenario: Cek input form dengan field Telephone kosong\r\nWhen Admin input field Supervisor\r\nAnd Admin kosongkan field Telephone\r\nAnd Admin klik tombol Save\r\nThen Muncul tampilan warning Mohon Lengkapi Data\r\n\r\n#TCC.PO.022\r\nScenario: Cek input form dengan field Username kosong\r\nWhen Admin input field Telephone\r\nAnd Admin kosongkan field Username\r\nAnd Admin klik tombol Save\r\nThen Muncul tampilan warning Mohon Lengkapi Data\r\n\r\n#TCC.PO.023\r\nScenario: Cek input form dengan field Password kosong\r\nWhen Admin input field Username\r\nAnd Admin kosongkan field Password\r\nAnd Admin klik tombol Save\r\nThen Muncul tampilan warning Mohon Lengkapi Data\r\n\r\n#TCC.PO.024\r\n@CekInputPassword\r\n  Scenario: Cek input form dengan password kurang dari 8 digit\r\n  When Admin input field Full Name \"test24\"\r\n  And Admin input field Privileges \"Admin\"\r\n  And Admin input field Supervisor \"ARIE\"\r\n  And Admin input field Telephone \"1234567890\"\r\n  And Admin input field Username \"uname24\"\r\n  And Admin input field Password \"12345\"\r\n  And Admin klik tombol Save\r\n  And Admin konfirmasi simpan data\r\n  Then Muncul notifikasi Pemberitahuan Password error\r\n\r\n#TCC.PO.025\r\n@CekInputPassword\r\nScenario: Cek input form dengan password lebih dari 16 digit\r\nWhen Admin input field Full Name \"IJN Takao\"\r\nAnd Admin input field Privileges \"Admin\"\r\nAnd Admin input field Supervisor \"SUPER\"\r\nAnd Admin input field Telephone \"0987673245\"\r\nAnd Admin input field Username \"uname25\"\r\nAnd Admin input field Password \"12345678123456781234\"\r\nAnd Admin klik tombol Save\r\nAnd Admin konfirmasi simpan data\r\nThen Muncul notifikasi Pemberitahuan Password error\r\n\r\n#TCC.PO.026\r\n@CekInputPassword\r\nScenario: Cek input form dengan password karakter angka saja\r\nWhen Admin input field Full Name \"IJN Choukai\"\r\nAnd Admin input field Privileges \"Admin\"\r\nAnd Admin input field Supervisor \"ARIE\"\r\nAnd Admin input field Telephone \"6578801234\"\r\nAnd Admin input field Username \"uname26\"\r\nAnd Admin input field Password \"13572468\"\r\nAnd Admin klik tombol Save\r\nAnd Admin konfirmasi simpan data\r\nThen Muncul notifikasi Pemberitahuan Password error\r\n\r\n#TCC.PO.027\r\n@CekInputPassword\r\nScenario: Cek input form dengan password karakter huruf saja\r\nWhen Admin input field Full Name \"IJN Maya\"\r\nAnd Admin input field Privileges \"Admin\"\r\nAnd Admin input field Supervisor \"SUPER\"\r\nAnd Admin input field Telephone \"56712345\"\r\nAnd Admin input field Username \"uname27\"\r\nAnd Admin input field Password \"qwerTYUI\"\r\nAnd Admin klik tombol Save\r\nAnd Admin konfirmasi simpan data\r\nThen Muncul notifikasi Pemberitahuan Password error\r\n\r\n#TCC.PO.028\r\n@CekInputPassword\r\nScenario: Cek input form dengan password karakter simbol saja\r\nWhen Admin input field Full Name \"HMS Belfast\"\r\nAnd Admin input field Privileges \"Admin\"\r\nAnd Admin input field Supervisor \"ARIE\"\r\nAnd Admin input field Telephone \"446578890\"\r\nAnd Admin input field Username \"uname28\"\r\nAnd Admin input field Password \",./*-+%!\"\r\nAnd Admin klik tombol Save\r\nAnd Admin konfirmasi simpan data\r\nThen Muncul notifikasi Pemberitahuan Password error\r\n\r\n#TCC.PO.029\r\n@CekInputPassword\r\nScenario: Cek input form dengan data valid\r\nWhen Admin input field Full Name\r\nAnd Admin input field Privileges\r\nAnd Admin input field Supervisor\r\nAnd Admin input field Telephone\r\nAnd Admin input field Username\r\nAnd Admin input field Password\r\nAnd Admin klik tombol Save\r\nAnd Admin konfirmasi simpan data\r\nThen Data berhasil disimpan","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///D:/Backup-Project/src/main/resources/features/04.FormAddAdmin.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Form Add Admin Test","description":"","children":[{"scenario":{"location":{"line":4,"column":1},"tags":[],"keyword":"Scenario","name":"Cek input form dengan field Full Name koso  dengan field Telephone kosong\r\n    When Admin search data admin \"uname27\" dengan Search bar\r\n    And Admin klik tombol action edit\r\n    And Admin edit field Telephone dengan data kosong\r\n    And Admin klik tombol Update\r\n    And Admin konfirmasi update data\r\n    Then Muncul tampilan warning Data Telephone Tidak Lengkap\r\n\r\n  #TCC.PO.034\r\n  Scenario: Check edit data admin dengan field User Active kosong\r\n    When Admin search data admin \"uname27\" dengan Search bar\r\n    And Admin klik tombol action edit\r\n    And Admin edit field User Active dengan data kosong\r\n    And Admin klik tombol Update\r\n    And Admin konfirmasi update data\r\n    Then Akun \"uname27\" tidak dapat login kedalam sistem\r\n\r\n  #TCC.PO.035\r\n  Scenario: Check edit data admin dengan field Username kosong\r\n    Given Admin sedang di menu Admin\r\n    When Admin search data admin \"test28\" dengan Search bar\r\n    And Admin klik tombol action edit\r\n    And Admin edit field Username dengan data kosong\r\n    And Admin klik tombol Update\r\n    And Admin konfirmasi update data\r\n    Then Username direset menjadi \"super\"\r\n\r\n  #TCC.PO.036\r\n  Scenario: Check edit data admin dengan field Full Name valid\r\n    When Admin search data admin \"uname25\" dengan Search bar\r\n    And Admin klik tombol action edit\r\n    And Admin edit field Full Name dengan data valid\r\n    And Admin klik tombol Update\r\n    And Admin konfirmasi update data\r\n    Then Full Name berhasil diedit\r\n\r\n  #TCC.PO.037\r\n  Scenario: Check edit data admin dengan field Privilege valid\r\n    When Admin search data admin \"uname25\" dengan Search bar\r\n    And Admin klik tombol action edit\r\n    And Admin edit field Privilege dengan data valid\r\n    And Admin klik tombol Update\r\n    And Admin konfirmasi update data\r\n    Then Privilege berhasil diedit\r\n\r\n  #TCC.PO.038\r\n  Scenario: Check edit data admin dengan field Supervisor valid\r\n    When Admin search data admin \"uname27\" dengan Search bar\r\n    And Admin klik tombol action edit\r\n    And Admin edit field Supervisor dengan data valid\r\n    And Admin klik tombol Update\r\n    And Admin konfirmasi update data\r\n    Then Supervisor berhasil diedit","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///D:/Backup-Project/src/main/resources/features/05.FormEditAdmin.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Form Edit Admin Test","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario","name":"Check edit data admin dengan field Full Name kosong","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"When ","keywordType":"Action","text":"Admin search data admin \"uname24\" dengan Search bar","id":"d7b3ac68-619e-470a-ab08-8376de4c5c05"},{"location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"Admin klik tombol action edit","id":"943f8d64-ed01-43ed-979e-d5aeb085628a"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"Admin edit field Full Name dengan data kosong","id":"bd07db39-1a9c-44f3-a81e-7cd3872e979c"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"Admin klik tombol Update","id":"52982f1d-5998-4449-9bcb-80d9edd8a04e"},{"location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"Admin konfirmasi update data","id":"ddd425f3-0896-45dc-9e65-6af18cc1704e"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Muncul tampilan warning Data Full Name Tidak Lengkap","id":"e129a90c-780f-44ea-aa0b-56749c83525b"}],"examples":[],"id":"f58087ce-a4c7-46db-ba44-50257d4e6b79"}},{"scenario":{"location":{"line":13,"column":3},"tags":[],"keyword":"Scenario","name":"Check edit data admin dengan field Privileges kosong","description":"","steps":[{"location":{"line":14,"column":5},"keyw
